          title: '\uD83D\uDD25HANeP\uD83D\uDD25 Giveaway: Join, Earn, Grow.',
          description:
            '{"type":"DRAFT_JS_RAW","data":{"blocks":[{"key":"dgi70","text":"\uD83C\uDFC6 Unleash the power of community: Join HANeP\'s social media, amplify our presence, and reap rewards galore - QuestN\'s Giveway and KHANs Staking\'s REWARD","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"1gbsi","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3pe03","text":"\uD83D\uDE80 HANePlatform-HANeP, along with HanChain-HAN, maintains consistent liquidity using \u201COne-Click Liquidity Provision & Staking Protocol\u201D on the Optimism Network. With this strategy, HANePlatform-HANeP is racing towards the TOP in the Optimism TVL rankings.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"apo97","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8d0re","text":"\uD83D\uDC69\u200D\uD83C\uDFEB What is the \u201COne-Click Liquidity Provision & Staking Protocol\u201D?","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"fkq6u","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b5ql","text":"This is a way to quickly and easily provide liquidity to Uniswap with just one ETH asset and one signature, and then proceed with staking to earn REWARD.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"638cf","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2avtu","text":"\uD83D\uDDB1 One signature suffices for All of the following procedures. EZ\uFE0F!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"ebc97","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"22qr","text":"Step-1. One-click signature for adding liquidity from ETH to the Contract.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"qvu8","text":"Step-2. 100% of ETH is converted to WETH.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7oj7f","text":"Step-3. 50% of WETH is used to purchase WBTC (for liquidity provision).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9bh35","text":"Step-4. The quantity of HANeP equivalent to the purchased WBTC is calculated (for liquidity provision).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"90cb2","text":"Step-5. 50% of WETH is used to purchase HANeP.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3jg9m","text":"Step-6. The WBTC from step 3 and HANeP from step 4 (Zero Fee, Zero Slippage) are provided as liquidity to Uniswap. ","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"1fijd","text":"\u2014 HANeP from step 5 that experienced slippage is only covered by reserves.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"888im","text":"Step-7. Uniswap LP staking begins (locked for a set period).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7n72k","text":"Step-8. Reward claims are made every second.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4kufg","text":"Step-9. After the locked period, a signature must be signed to remove liquidity from the Contract.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"e4pte","text":"\u2014 If no signature is provided, rewards will continue to accrue per second until the quota is exhausted.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"c2utv","text":"Step-10. WBTC and HANeP are withdrawn in quantities proportional to the LP share of the liquidity.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"1tv89","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b421j","text":"\uD83D\uDC49 Details link:","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7fadr","text":"https://github.com/hanchain-paykhan/launchpad.khans.io/tree/main/HANePlatform#stake-hanep-wbtc-liquidity-to-hanep-x-musikhan-launchpad","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}}',
