          title: '\uD83D\uDD25HAN\uD83D\uDD25 Giveaway: Join, Earn, Grow.',
          description:
            '{"type":"DRAFT_JS_RAW","data":{"blocks":[{"key":"a9bvk","text":"\uD83C\uDFC6 Unleash the power of community: Join HAN\'s social media, amplify our presence, and reap rewards galore - QuestN\'s Giveway and KHANs Staking\'s REWARD","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cucj8","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cde9t","text":"\uD83D\uDE80 HanChain-HAN, maintains consistent liquidity using \u201COne-Click Liquidity Provision & Staking Protocol\u201D on the Optimism Network. With this strategy, HanChain-HAN is racing towards the TOP in the Optimism TVL rankings.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7ohru","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"efn4c","text":"\uD83D\uDC69\u200D\uD83C\uDFEB What is the \u201COne-Click Liquidity Provision & Staking Protocol\u201D?","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bgju2","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7llog","text":"This is a way to quickly and easily provide liquidity to Uniswap with just one ETH asset and one signature, and then proceed with staking to earn REWARD.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"fvhv6","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"84j2u","text":"\uD83D\uDDB1 One signature suffices for All of the following procedures. EZ\uFE0F!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8ujt","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4n3n8","text":"Step-1. One-click signature for adding liquidity from ETH to the Contract.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"69ver","text":"Step-2. 100% of ETH is converted to WETH.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3ik60","text":"Step-3. 50% of WETH is used to purchase WBTC (for liquidity provision).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bjtjb","text":"Step-4. The quantity of HAN equivalent to the purchased WBTC is calculated (for liquidity provision).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"290vf","text":"Step-5. 50% of WETH is used to purchase HAN.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"6in1","text":"Step-6. The WBTC from step 3 and HAN from step 4 (Zero Fee, Zero Slippage) are provided as liquidity to Uniswap.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"53cca","text":"\u2014 HAN from step 5 that experienced slippage is only covered by reserves.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b2cl1","text":"Step-7. Uniswap LP staking begins (locked for a set period).","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8tota","text":"Step-8. Reward claims are made every second.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"88s27","text":"Step-9. After the locked period, a signature must be signed to remove liquidity from the Contract.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"6v17i","text":"\u2014 If no signature is provided, rewards will continue to accrue per second until the quota is exhausted.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"a78q0","text":"Step-10. WBTC and HAN are withdrawn in quantities proportional to the LP share of the liquidity.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"ae5du","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"e7e88","text":"\uD83D\uDC49 Details link:","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"40bhc","text":"https://github.com/hanchain-paykhan/launchpad.khans.io/tree/main/HanChain#stake-han-wbtc-liquidity-to-han-launchpad","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{}}}',
