          title: 'BBAChain Campaign For Youtubers',
          description:
            '{"type":"DRAFT_JS_RAW","data":{"blocks":[{"key":"ddds2","text":"Earn Rewards by Promoting BBAChain!","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":35,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"cdc8h","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"masr","text":"We\u2019re excited to launch our latest campaign where you can earn crypto by showcasing BBAChain on your YouTube channel! Here\'s how it works:","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"11qoe","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"d986n","text":"Campaign Requirements:","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":22,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"aod08","text":"Create a Video: Participants must create a minimum 5-minute video about BBAChain. Your content should highlight key aspects of our project, ecosystem, or any unique features that you find appealing.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":15,"style":"BOLD"},{"offset":43,"length":22,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"8doop","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"1kel8","text":"Include a Referral Code: In your video, you must mention one of the referral codes that we will provide.  (Click here and choose one of these referral codes to mention in the video and the description)","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":24,"style":"BOLD"},{"offset":106,"length":95,"style":"UNDERLINE"}],"entityRanges":[{"offset":106,"length":95,"key":0}],"data":{}},{"key":"er6i0","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"b9na6","text":"YouTube Channel Criteria: Your YouTube channel must have at least 20,000 subscribers. Your channel should have a history of content, with at least 10 videos already uploaded before participating in this campaign. The video must be in one of the following languages: English, Spanish, French, Russian, German, Chinese, or Portuguese.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":26,"style":"BOLD"},{"offset":66,"length":18,"style":"BOLD"},{"offset":138,"length":18,"style":"BOLD"},{"offset":266,"length":66,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"c4ekf","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"anr20","text":"Video Quality: Videos that show a face will be given priority, as personal engagement is highly valued. Faceless videos are accepted, but they must be of very high quality with excellent editing and presentation. Create a compelling thumbnail for your video to attract viewers.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":15,"style":"BOLD"},{"offset":154,"length":17,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"8lo57","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"239ta","text":"Submission Verification: All submissions will be manually verified by our team to ensure they meet our quality standards and all specified requirements. We will check the content, the inclusion of the referral code, and the channel\u2019s subscriber count and content history.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":25,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"bs1g3","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"fkdsm","text":"Additional Points to Consider: Make sure your video is engaging and informative, providing value to your audience about BBAChain. (Feel free to use our template scripts or create your own based on these). ","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":31,"style":"BOLD"},{"offset":130,"length":75,"style":"UNDERLINE"}],"entityRanges":[{"offset":130,"length":73,"key":1}],"data":{}},{"key":"f92p3","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"6g2bo","text":"Use clear visuals, good lighting, and sound quality to enhance your presentation. Creativity is encouraged\u2014feel free to add your unique style to the video while maintaining accuracy about BBAChain.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"fqi03","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"56p13","text":"Reward Distribution: After the verification process, eligible participants will receive their rewards. Please note that the quality and impact of your video will be considered in the reward allocation process.","type":"ordered-list-item","depth":0,"inlineStyleRanges":[{"offset":0,"length":21,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"94m2t","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"7dtj9","text":"NOTE: DO NOT TRY TO CHEAT! You need to submit the link of the video you created and you need to submit a screenshot of your YouTube channel Dashboard, we will check every submission manually every 2 hours and we will reject those trying to cheat or not fulfilling the requirements.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":26,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"3o1m2","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"5i17t","text":"How to Participate:","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":19,"style":"BOLD"}],"entityRanges":[],"data":{}},{"key":"bj6ev","text":"Follow the above guidelines to create and upload your video.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9iim8","text":"Share the video link with us through the submission form provided.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"11au6","text":"Share a screenshot of your YouTube channel Dashboard to prove that it belongs to you","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"63sdm","text":"Await confirmation from our team once your submission has been reviewed.","type":"unordered-list-item","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"eqjee","text":"First Come First Served but if your submission is not valid you will lose it. ","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"at2ii","text":"We are thrilled to see how you will present BBAChain to your audience and look forward to your creative contributions. Let\u2019s make this campaign a success together!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"d3k66","text":"If you have any questions or need further information, feel free to contact us. Good luck, and thank you for supporting BBAChain!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{"0":{"type":"LINK","mutability":"MUTABLE","data":{"url":"https://docs.google.com/document/d/1A3oHpipBljBh1XRjM_br3fBrJvJ20yf7jfQoFSxs_zI/edit?usp=sharing"}},"1":{"type":"LINK","mutability":"MUTABLE","data":{"url":"https://docs.google.com/document/d/1yIArLz2TENI0m3LVD4D0P_Dog07l7AxezhUhKHF0MII/edit?usp=sharing"}}}}}',
